/*hamburger-menu*/
#menu__toggle {
  opacity: 0;
  pointer-events: none;
}

#menu__toggle:checked ~ .menu__btn > span {
  transform: rotate(45deg);
}
#menu__toggle:checked ~ .menu__btn > span::before {
  top: 0;
  transform: rotate(0);
}
#menu__toggle:checked ~ .menu__btn > span::after {
  top: 0;
  transform: rotate(90deg);
}
#menu__toggle:checked ~ .menu__box {
  visibility: visible;
  left: 0;
}

.menu__btn {
  display: flex;
  align-items: center;
  position: fixed;
  top: 20px;
  right: 20px;
  width: 27px;
  height: 26px;
  cursor: pointer;
  z-index: 999;
}
@media (min-width: 660px) {
  .menu__btn {
    top: 26px;
  }
}
@media (min-width: 960px) {
  .menu__btn {
    display: none;
  }
}
.menu__btn > span,
.menu__btn > span::before,
.menu__btn > span::after {
  display: block;
  position: absolute;
  width: 100%;
  height: 2px;
  background-color: #000000;
  transition-duration: .25s;
}
.menu__btn > span::before {
  content: '';
  top: -8px;
}
.menu__btn > span::after {
  content: '';
  top: 8px;
}

.menu__box {
  display: block;
  position: fixed;
  visibility: hidden;
  text-align: center;
  z-index: 999;
  top: 0;
  left: -100%;
  width: 100%;
  height: 100%;
  margin-top: 68px;
  padding: 0px;
  list-style: none;
  background-color: #ffffff;
  transition-duration: .25s;
}
@media (min-width: 960px) {
  .menu__box,
  .list-menu__hamburger-menu {
    display: none;
  }
}
.menu__item {
  display: block;
  padding-bottom: 15px;
  padding-top: 10px;
  box-sizing: border-box;
  padding-left: 20px;
  padding-right: 20px;
  color: #000000;
  font-family: 'Montserrat', sans-serif;
  font-size: 20px;
  font-weight: 500;
  background-color: #ffffff;
  text-decoration: none;
  transition-duration: .25s;
}
.menu__item:hover {
  font-weight: bold;
}
.menu__item::after {
  background-color: #000000;
  display: block;
  content: "";
  height: 3px;
  width: 0%;
  -webkit-transition: width .3s ease-in-out;
  -moz--transition: width .3s ease-in-out;
  transition: width .3s ease-in-out;
}
.menu__item:hover::after,
.menu__item:focus::after {
    width: 100%;
}
