/* Слайдер */

.slider {
  position: relative;
  overflow: hidden;
  transition: 0.3s;
}

.slider ul {
  position: absolute;
}

.slider li {
  float: left;
  line-height: 0;
  text-align: center;
  width: 100%;
  height: 240px;
}
.first__slide {
  background-image: url(../images/image-13x.png);
  background-repeat: no-repeat;
  background-size: cover;
}
.second__slide {
  background-image: url(../images/image-23x.png);
  background-repeat: no-repeat;
  background-size: cover;
}
.third__slide {
  background-image: url(../images/image-33x.png);
  background-repeat: no-repeat;
  background-size: cover;
}
@media (min-width: 660px) {
  .slider li {
    height: 280px;
  }
}
@media (min-width: 960px) {
  .slider li {
    height: 600px;
  }
}
.navigator {
  position: absolute;
  bottom: 11px;
  width: 100%;
  text-align: center;
}
@media (min-width: 960px) {
  .navigator {
    bottom: 45px;
  }
}

.navigator span {
  display: inline-block;
  width: 30px;
  height: 2px;
  border-radius: 3px;
  background-color: #F7F7F7;
  margin: 0 11px;
  transition: 0.1s;
  position: relative;
  top: 0;
}
@media (min-width: 960px) {
  .navigator span {
    width: 70px;
    height: 2px;
  }
}

.navigator span.active {
  background-color: #14A5DA;
  width: 30px;
  height: 2px;
}
@media (min-width: 960px) {
  .navigator span.active {
    width: 70px;
    height: 2px;
  }
}

.slider > span:nth-child(1) {
  position: absolute;
  bottom: 11px;
  left: 15px;
  z-index: 1;
  color: white;
  cursor: pointer;
  transition: 0.3s;
  width: 18px;
  height: 13px;
  background-image: url(../images/left-arrow-1.svg);
  background-repeat: no-repeat;
  background-size: contain;
}
@media (min-width: 960px) {
  .slider > span:nth-child(1) {
    width: 31px;
    height: 22px;
    bottom: 45px;
  }
}
.slider > span:nth-child(2) {
  position: absolute;
  bottom: 11px;
  right: 15px;
  z-index: 1;
  color: white;
  cursor: pointer;
  transition: 0.3s;
  width: 18px;
  height: 13px;
  background-image: url(../images/left-arrow-2.svg);
  background-repeat: no-repeat;
  background-size: contain;
}
@media (min-width: 960px) {
  .slider > span:nth-child(2) {
    width: 31px;
    height: 22px;
    bottom: 45px;
  }
}

.prev {
  left: 0;
}

.next {
  right: -1px;
}

.slider:hover span, .slider:hover .autoPlay {
  transform: rotate(0deg);
}

.autoPlay {
  position: absolute;
  bottom: 0;
  left: 0;
  color: white;
  transform: translateY(50px);
  transition: .3s;
}

.autoPlay label {
  background: rgba(0, 0, 0, .4);
  padding: 10px;
  display: block;
}

.autoPlay .chkbox {
  display: none;
}

.autoPlay .chkbox:checked + label {
  background: rgba(0, 0, 0, .7);
}

